import React , {useState}  from "react";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import { useDispatch, useSelector } from "react-redux";
import {RootStore} from "./Store";
import {GetUserInfo , GetUserAge} from "./Action/UserActions";


function App() {
  const dispatch = useDispatch();
  const [userName1 , setUserName1] = useState("")
  const [userName2 , setUserName2] = useState("")
  const [userName3 , setUserName4] = useState("")
  const userSates = useSelector((state: RootStore) => state.userinfo);
  const userAge = useSelector((state: RootStore) => state.userAge);
  const handleSerchUser = () => dispatch(GetUserInfo(3));
  const handleAge = () => dispatch(GetUserAge(userName1 , userName2 , userName3))




  return (
    <div className="App">
      <React.Fragment>
        <Container maxWidth="lg">
          {console.log(userAge)}
        {userSates.userinfo && (
        <div>
          {userSates.userinfo.results[0].map(val => {
            console.log(val)
            return <Typography>{val.name.first + val.name.last}</Typography> 
          })}
          </div>
        )}
          {/* <Typography>{state}</Typography> */}
          <button onClick={() => handleSerchUser()}>serch Users</button>
          <button onClick={() => handleAge()}>age</button>
        </Container>
      </React.Fragment>
    </div>
  );
}

export default App;
